import React from "react";
import "./output.css";

function Button(props) {
  return (
    <div className="h-[6vh] w-[8vw] border border-white rounded-xl flex justify-center items-center bg-[#914BF1] mt-10">
      {props.text}
    </div>
  );
}

export default Button;
